message:
Só reconhecerei o VITORIOSO no PLEITO ELEITORAL 2O22, após às #FFAA apresentarem os três (3) RELATÓRIOS do PROCESSO ELEITORAL aos BRASILEIROS.

É DIREITO CONSTITUCIONAL à PARTICIPAÇÃO  POLÍTICA do CIDADÃO no PROCESSO ELEITORAL, da mesma forma a LISURA e TRANSPARÊNCIA nas ELEIÇÕES.

Sendo assim deposito toda  CONFIANÇA nas FORÇAS ARMADAS pois são INSTITUIÇÕES PÚBLICAS  respeitadas pela SOCIEDADE. Contribuem para a garantia da SOBERANIA NACIONAL, dos PODERES CONSTITUCIONAIS, da LEI e da ORDEM.

Portanto AGUARDO o RELATÓRIO das FFAA para RECONHECER PUBLICAMENTE o PRESIDENTE ELEITO DEMOCRATICAMENTE.

